// fe/src/pages/RegisterSelection.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './RegisterSelection.css'; // Create this CSS file for styling if needed

const RegisterSelection = () => {
    const navigate = useNavigate();

    return (
        <div className="register-selection">
            <h1>Choose Registration Type</h1>
            <button onClick={() => navigate('/register/normal')}>Register as Normal User</button>
            <button onClick={() => navigate('/register/business')}>Register as Business User</button>
        </div>
    );
};

export default RegisterSelection;
